import axios from 'axios'
import React, { useEffect, useState } from 'react'

const ListJ = () => {
    const [myusers,setmyuser]=useState([])
    useEffect(function(){
      axios.get('http://localhost:1234/Users/getAll').then(v=>{setmyuser(v.data)})
    },[])
  return <div>{myusers?.map((n)=>(<p>{n.name}--{n.matconim}--{n.adress}--{n.password}--{n.phone}</p>))}</div>
  
}

export default ListJ
